import React from 'react';

const OtherP: React.FC = () => {
  return (
    <div className="min-h-screen bg-[#F4F1EC]">
      <div className="max-w-6xl mx-auto px-8 py-16">
        <div className="mt-32 text-center">
          <div className="h-[1px] w-full max-w-[300px] bg-gray-300 mb-8 mx-auto" />
          <h2 className="about-title">Other Projects</h2>
        </div>

        <div className="grid grid-cols-1 gap-8 mt-12">
          <div className="relative overflow-hidden rounded-lg border border-black bg-white transition-all duration-300 hover:shadow-lg">
            <img 
              src="/card4.png" 
              alt="Brand Design" 
              className="w-full h-80 object-cover"
            />
            <div className="p-4">
              <h3 className="text-xl font-semibold">CELESTE'S OTHER PROJECTS</h3>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OtherP;
